import React from 'react';

function Register() {
  return (
    <div className="col-md-6 offset-md-3">
      <h2>Đăng ký</h2>
      <p>Chức năng đăng ký sẽ được cập nhật sau.</p>
    </div>
  );
}

export default Register;
